const headers = {
  "Content-type": "application/json",
};
const sendData = (noOfStudents, totalClasses, expense, revenue, profit) => {
  const data = JSON.stringify({
    noOfStudents: noOfStudents,
    totalClasses: totalClasses,
    expense: expense,
    revenue: revenue,
    profit: profit,
  });
  let dataToSend;
  axios
    .get(`${process.env.REACT_APP_DEV_URL}/add/`, data, {
      headers,
    })
    .then((res) => {
      let dataToSend = res.data;
      console.log(dataToSend);
    })
    .catch((e) => {
      console.log(e);
      dataToSend = null;
    });
};
